import React, { useState } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';
import LoginForm from "./components/LoginForm";

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Study Buddy</h1>
        <Switch>
          <Route exact path="/" component={LoginForm} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
